import React from "react";
import './style.css';
import Card from '../Card';
import essay from '../../assets/essay.jpg';

const BlogPost = props => {
    return (
        <div className = "blogPostContainer">
            <Card>
                <div className = "blogHeader">
                    <h1 className = "blogTitle">11 Essay Collections For When A Novel Feels Too Much</h1>
                    <span className = "postedOn">Posted on July 6, 2021</span>
                </div>
                <div className = "postImage">
                    <img src = {essay} className = "essayImage" alt = "image"/>
                </div>
            </Card>

            <Card>
                <div className = "blogHeader">
                    <h1 className = "blogTitle">11 Essay Collections For When A Novel Feels Too Much</h1>
                    <span className = "postedOn">Posted on July 6, 2021</span>
                </div>
                <div className = "postImage">
                    <img src = {essay} className = "essayImage" alt = "image"/>
                </div>
            </Card>
        </div>
    )
};

export default BlogPost;
